il" href="mailto:${email}"\n									style="font-family: Arial; font-size: 10px; font-weight: normal;font-style: normal; font-stretch: normal;line-height: normal;letter-spacing: normal;color: #999999; text-decoration: none;"\n								><strong>E: </strong>${email}</a>\n							</td>\n						</tr>\n\n					<tr>\n						<td>\n							<a class="firma-web" href="${web}"\n								style="font-family: Arial; font-size: 10px; font-weight: normal;font-style: normal; font-stretch: normal;line-height: normal;letter-spacing: normal;color: #999999; text-decoration: none;"\n							>${web}</a>\n						</td>\n					</tr>\n\n					</tbody>\n				</table>\n			</td>\n		</tr>\n		</tbody>\n	</table>\n	<div style="height: 60px;"></div>\n</div>', 'Vego supermercados s.a.', 'La Coruña', 'La Coruña', '{"mailSender":"info@bolder.com","host":"webmail.bolder.com","port":25,"username":"info@bolder.com","password":"112233kk","smtpAuth":true,"smtpTtls":false}', '981179305', 'www.vegalsa.es');
